import React from "react";

class Footer extends React.Component {
  render() {
    return (
      <footer>
        <ul>
          <li>About</li>
          <li>Customer Care</li>
          <li>Instagram</li>
        </ul>
        <h3>@pretend store</h3>
      </footer>
    );
  }
}
export default Footer;
